// TextNode.jsx - Text node with dynamic handles for variables

import { useState, useEffect, useMemo, useCallback } from 'react';
import { BaseNode } from './BaseNode';
import { nodeConfig } from '../../config/nodeConfig';
import { useStore } from '../../store';

const config = nodeConfig.text;

// Extract variables from text using {{variableName}} pattern
const extractVariables = (text) => {
  const regex = /\{\{([a-zA-Z_$][a-zA-Z0-9_$]*)\}\}/g;
  const variables = new Set();
  let match;
  while ((match = regex.exec(text)) !== null) {
    variables.add(match[1]);
  }
  return Array.from(variables);
};

export const TextNode = ({ id, data, selected }) => {
  const [text, setText] = useState(data?.text || '{{input}}');
  const updateNodeField = useStore((state) => state.updateNodeField);

  // Extract variables for dynamic handles
  const variables = useMemo(() => extractVariables(text), [text]);

  // Create dynamic inputs from variables
  const dynamicInputs = useMemo(() => {
    return variables.map((varName) => ({
      id: varName,
      label: varName,
    }));
  }, [variables]);

  // Calculate dynamic dimensions based on text content
  const dimensions = useMemo(() => {
    const lines = text.split('\n');
    const lineCount = lines.length;
    const maxLineLength = Math.max(...lines.map(line => line.length), 0);

    const baseWidth = 260;
    const baseHeight = 140;
    const charWidth = 6.5;
    const paddingWidth = 80;
    const lineHeight = 18;
    const paddingHeight = 100;

    const calculatedWidth = Math.min(
      Math.max(baseWidth, maxLineLength * charWidth + paddingWidth),
      400
    );

    const calculatedHeight = Math.min(
      Math.max(baseHeight, lineCount * lineHeight + paddingHeight),
      350
    );

    return { width: calculatedWidth, height: calculatedHeight };
  }, [text]);

  // Update store when text changes
  useEffect(() => {
    updateNodeField(id, 'text', text);
  }, [id, text, updateNodeField]);

  // Update store with current variables
  useEffect(() => {
    updateNodeField(id, 'variables', variables);
  }, [id, variables, updateNodeField]);

  const handleTextChange = useCallback((e) => {
    setText(e.target.value);
  }, []);

  return (
    <BaseNode
      id={id}
      title={config.title}
      icon={config.icon}
      category={config.category}
      inputs={dynamicInputs}
      outputs={config.defaultOutputs}
      selected={selected}
      minWidth={dimensions.width}
      minHeight={dimensions.height}
    >
      <div className="space-y-2">
        <label className="text-xs font-medium text-slate-500 uppercase tracking-wide">
          Text
        </label>
        <textarea
          value={text}
          onChange={handleTextChange}
          placeholder="Enter text with {{variables}}"
          className="w-full p-2 text-sm font-mono bg-slate-50 border border-slate-200 rounded-md focus:outline-none focus:bg-white focus:border-primary focus:ring-1 focus:ring-primary/20 transition-colors resize-none"
          style={{ minHeight: Math.max(60, text.split('\n').length * 20 + 10) }}
        />
      </div>

      {/* Variables display */}
      {variables.length > 0 && (
        <div className="pt-2 border-t border-slate-100">
          <div className="flex items-center justify-between mb-1.5">
            <span className="text-[10px] font-medium text-slate-400 uppercase tracking-wide">
              Variables
            </span>
            <span className="text-[10px] font-medium text-primary bg-primary/10 px-1.5 py-0.5 rounded">
              {variables.length}
            </span>
          </div>
          <div className="flex flex-wrap gap-1">
            {variables.map((v) => (
              <span
                key={v}
                className="inline-flex items-center px-1.5 py-0.5 text-[10px] font-medium bg-slate-100 text-slate-600 rounded border border-slate-200"
              >
                <span className="text-slate-400">{'{'}</span>
                <span className="text-slate-400">{'{'}</span>
                {v}
                <span className="text-slate-400">{'}'}</span>
                <span className="text-slate-400">{'}'}</span>
              </span>
            ))}
          </div>
        </div>
      )}

      {/* Help text when no variables */}
      {variables.length === 0 && (
        <p className="text-[10px] text-slate-400">
          Use <code className="px-1 py-0.5 bg-slate-100 rounded text-[9px] font-mono">{'{{variable}}'}</code> for inputs
        </p>
      )}
    </BaseNode>
  );
};

export default TextNode;
